import React from 'react';


class App extends React.Component{

  state = {
    count : 0
  };

  render(){
    return (
      <div> 
        <h1>Current Number :  {this.state.count}</h1>
        <button>더하기</button>
        <button>빼기</button>
      </div>
    )
  }
}

export default App;
